css:
atom-text-editor,
:host {
  background-color: #1b2b34;
  color: #cdd3de;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #1b2b34;
  color: #cdd3de;
}
atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: rgba(101, 115, 126, 0.33);
  color: #cdd3de;
}
atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  color: #cdd3de;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  color: #48555d;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #35434b;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #4b535b;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: #65737e;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: #cdd3de;
}
atom-text-editor.is-focused .cursor,
:host(.is-focused) .cursor {
  border-color: #c0c5ce;
}
atom-text-editor.is-focused .selection .region,
:host(.is-focused) .selection .region {
  background-color: #4f5b66;
}
atom-text-editor.is-focused .line-number.cursor-line-no-selection,
atom-text-editor.is-focused .line.cursor-line,
:host(.is-focused) .line-number.cursor-line-no-selection,
:host(.is-focused) .line.cursor-line {
  background-color: rgba(101, 115, 126, 0.33);
}
.comment,
.punctuation.definition.comment {
  color: #65737e;
}
.variable {
  color: #CDD3DE;
}
.function > .variable {
  color: #F99157;
}
.keyword,
.storage.modifier,
.storage.type {
  color: #C594C5;
}
.keyword.control,
.keyword.operator,
.constant.other.color,
.punctuation,
.punctuation.string,
.meta.tag,
.punctuation.definition.tag,
.punctuation.separator.inheritance.php,
.punctuation.definition.tag.html,
.punctuation.definition.tag.begin.html,
.punctuation.definition.tag.end.html {
  color: #5FB3B3;
}
.entity.name.tag,
.meta.tag.sgml,
.markup.deleted.git_gutter {
  color: #EB606B;
}
.entity.name.function,
.meta.function-call,
.support.function,
.keyword.other.special-method,
.meta.block-level {
  color: #6699CC;
}
.support.other.variable,
.string.other.link {
  color: #F2777A;
}
.constant.numeric,
.constant.language,
.support.constant,
.constant.character,
.variable.parameter,
.punctuation.section.embedded,
.keyword.other.unit {
  color: #F99157;
}
.string,
.variable.quoted.elixir,
.constant.other.symbol,
.entity.other.inherited-class,
.markup.heading,
.markup.inserted.git_gutter {
  color: #99C794;
}
.variable.constant.elixir,
.entity.name.type,
.entity.name.class,
.entity.name.type.class,
.support.type,
.support.class,
.support.orther.namespace.use.php,
.meta.use.php,
.support.other.namespace.php,
.markup.changed.git_gutter {
  color: #FAC863;
}
.entity.name.module.js,
.variable.import.parameter.js,
.variable.other.class.js {
  color: #EC5F67;
}
.variable.language {
  font-style: italic;
  color: #EC5F67;
}
.entity.name.method.js {
  color: #D8DEE9;
}
.meta.method.js {
  color: #fff;
}
.entity.other.attribute-name {
  color: #BB80B3;
}
.markup.inserted {
  color: #99C794;
}
.markup.deleted {
  color: #EC5F67;
}
.markup.changed {
  color: #BB80B3;
}
.string.regexp {
  color: #5FB3B3;
}
.constant.character.escape {
  color: #5FB3B3;
}
.constant.character.escape.css,
.constant.character.escape.scss {
  color: #99C794;
}
* .url *,
* .link *,
* .uri * {
  text-decoration: underline;
}
